window.bookSummaryJSON = "<p><b>Forget \"losing weight\" - you want to lose <i>fat</i>...and if you want to know how to do it as quickly as possible without losing muscle...and without doing hours and hours of grueling cardio every week...then you want to listen to this audiobook.</b> </p> <p>What if I told you that you could dramatically transform your body eating foods you actually like...every day...seven days per week? </p> <p>What if all you had to do to lose fat and not muscle was follow a handful of flexible dietary guidelines...not starve and deprive yourself? </p> <p>And what if I promised you could forever break free of the anxieties most people associate with \"dieting\" and make it something you can enjoy as a lifestyle instead? </p> <p><b>Well, by the end of this book, you'll know exactly what you need to do to get a lot more out of a lot less exercise...and a lot more delicious food...than you ever thought possible.</b> </p> <p>Here's a \"sneak peek\" of some of the things this book will teach you.... </p> <ul> <li>The biggest diet lie you've been told (and probably believe) that makes losing fat <i>way</i> harder than it has to be. </li> <li>Why \"clean eating\" is overrated and guarantees nothing in the way of losing fat and building muscle...and what you should do instead. </li> <li>Five simple eating eating habits that keep you lean, healthy, and happy...without having to obsess over every calorie you eat. </li> <li>How to use \"fasted cardio\" to lose fat...and stubborn fat in particular...even faster. </li> <li>Seven powerful cardio workouts that will help you burn fat and not muscle in less than 30 minutes per day (and you don't even have to do them every day!). </li> <li>And a whole lot more! </li> </ul> <p></p> <p><b>Buy this book now and begin your journey to a leaner, sexier, healthier you!</b> </p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying reference material will be available in your My Library section along with the audio.</b></p>"; 
